INSERT INTO `landing_pages` VALUES (1,'Xilinx FPGA KIT',7,'<div>&nbsp;</div>\r\n\r\n<div><strong>Product Description</strong><br />\r\nThe Virtex&reg;-7 FPGA VC707 Evaluation Kit is a full-featured, highly-flexible, high-speed serial base platform using the Virtex-7 XC7VX485T-2FFG1761C and includes basic components of hardware, design tools, IP, and pre-verified reference designs for system designs that demand high-performance, serial connectivity and advanced memory interfacing. The included pre-verified reference designs and industry-standard FPGA Mezzanine Connectors (FMC) allow scaling and customization with daughter cards.</div>\r\n\r\n<div>Key Features &amp; Benefits</div>\r\n\r\n<ul class=\"ul-list-features-product\">\r\n	<li>40Gb/s Connectivity platform for high-bandwidth and high-performance applications using Virtex-7 VX485T FPGAs</li>\r\n	<li>Hardware, design tools, IP, and pre-verified reference designs</li>\r\n	<li>Supports embedded processing with MicroBlaze, soft 32bit RISC</li>\r\n	<li>Enabling serial connectivity with PCIe Gen2x8, SFP+ and SMA Pairs, UART, IIC</li>\r\n	<li>Advanced memory interface with 1GB DDR3 SODIM Memory up to 800MHz / 1600Mbps</li>\r\n	<li>Develop networking applications with 10-100-1000 Mbps Ethernet (GMII, RGMII and SGMII)</li>\r\n	<li>Expand I/O with the FPGA Mezzanine Card (FMC) interface</li>\r\n</ul>\r\n','2017-11-03 03:30:47','2017-11-03 04:47:10','Kit.png','image/png',2361365,'2017-11-03 04:03:40');
/*!40000 ALTER TABLE `landing_pages` ENABLE KEYS */;
UNLOCK TABLES;

