tyle: initial; text-decoration-color: initial; text-align: justify;\">Founded in the year 1981 by Daniel Borel and Pierluigi Zappacosta (Stanford, PhD Alumuni), Logitech International S.A. is involved in the developing and marketing of accessories for personal computers and tablets. Former managers of Olivetti, Jean-Iuc Mazzone and Giacomo Marini are the other two founders of the company. It has headquarters in Lausanne, Switzerland and in Newark, California, the United States of America. Logitech also has offices in Europe and Asia. The major product line of the company is Webcams, Keyboards, Game Controllers, Mice, Microphones, Wireless Audio Devices, Audio Devices for MP3 Players &amp; Mobile Phones etc.</p>\r\n</body></html>\n',32.00,660,NULL,'Logitech',17,1,'Camera','English','quickcam-logitech-c270h','2017-10-16 08:27:11','2017-10-24 06:25:28','cam.jpg','image/jpeg',25450,'2017-10-24 06:25:28',NULL,0.00),(3,'Hydro Series Liquid CPU Cooler','<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><body>\n<div style=\'margin: 20px 0px 0px; padding: 0px; color: rgb(0, 0, 0); font-family: \"Gotham SSm A\", \"Gotham SSm B\"; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\'>\r\n<h1 style=\'margin: 0.67em 0px 10px; padding: 0px; font-size: 28px; font-family: \"Open Sans\", arial, sans-serif; font-weight: 700; color: rgb(0, 0, 0); line-height: 33px;\'>A 280mm radiator and dual SP140L PWM fans provide the excellent heat dissipation you need for highly overclocked CPUs</h1>\r\n</div>\r\n\r\n<p style=\'margin: 0px 0px 20px; padding: 0px; font-size: 14px; color: rgb(0, 0, 0); line-height: 19px; display: block; -webkit-margin-before: 1em; -webkit-margin-after: 1em; -webkit-margin-start: 0px; -webkit-margin-end: 0px; font-family: \"Open Sans\", arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\'><img src=\"http://www.corsair.com/en-eu/~/media/A1F6EA2764184C52BFEC5C20B07ADFA0.ashx?w=640\" style=\"max-width: 100%; width: auto; height: auto;\" width=\"640\"></p>\r\n\r\n<div style=\'margin: 15px 0px 0px; padding: 0px; color: rgb(0, 0, 0); font-family: \"Gotham SSm A\", \"Gotham SSm B\"; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\'>\r\n<p style=\'margin: 0px 0px 20px; padding: 0px; font-size: 14px; color: rgb(0, 0, 0); line-height: 19px; display: block; -webkit-margin-before: 1em; -webkit-margin-after: 1em; -webkit-margin-start: 0px; -webkit-margin-end: 0px; font-family: \"Open Sans\", arial, sans-serif;\'>The Hydro Series H110i is an extreme performance, all-in-one liquid CPU cooler for cases with 280mm radiator mounts. The 280mm radiator and dual SP140L PWM fans provide the excellent heat dissipation you need for highly overclocked CPUs. Its Corsair Link compatible, so you can customize cooling performance, monitor system temperature, and change the color of the RGB LED lighting.</p>\r\n</div>\r\n\r\n<div class=\"box-clear-40\" style=\'margin: 0px; padding: 5px 0px; height: 40px; clear: both; color: rgb(0, 0, 0); font-family: \"Gotham SSm A\", \"Gotham SSm B\"; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\'></div>\r\n\r\n<div style=\'margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: \"Gotham SSm A\", \"Gotham SSm B\"; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; height: auto;\'>\r\n<div style=\"margin: 0px; padding: 0px; height: auto; width: 380px; float: left;\">\r\n<div class=\"product-detail-titles\" style=\'margin: 80px 0px 0px; padding: 0px; font-size: 22px; line-height: 24px; font-family: \"Open Sans\", arial, sans-serif; font-weight: 400; color: rgb(0, 0, 0);\'>280mm radiator</div>\r\n\r\n<div style=\"margin: 15px 0px 0px; padding: 0px;\">\r\n<p style=\'margin: 0px 0px 20px; padding: 0px; font-size: 14px; color: rgb(0, 0, 0); line-height: 19px; display: block; -webkit-margin-before: 1em; -webkit-margin-after: 1em; -webkit-margin-start: 0px; -webkit-margin-end: 0px; font-family: \"Open Sans\", arial, sans-serif;\'>The secret to fast, efficient cooling is maximizing cooling surface area. If your PC case has dual 140mm fan mounts spaced for a 280mm radiator, the H110i lets you take advantage of your cases full cooling potential.</p>\r\n</div>\r\n\r\n<div class=\"product-detail-titles\" style=\'margin