al; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\'><img src=\"http://www.corsair.com/en-eu/~/media/E18A528336964AD29CF01101B1A0458F.ashx?w=750\" style=\"max-width: 100%; width: auto; height: auto;\"></p>\r\n\r\n<div style=\'margin: 15px 0px 0px; padding: 0px; color: rgb(0, 0, 0); font-family: \"Gotham SSm A\", \"Gotham SSm B\"; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\'>\r\n<p style=\'margin: 0px 0px 20px; padding: 0px; font-size: 14px; color: rgb(0, 0, 0); line-height: 19px; display: block; -webkit-margin-before: 1em; -webkit-margin-after: 1em; -webkit-margin-start: 0px; -webkit-margin-end: 0px; font-family: \"Open Sans\", arial, sans-serif;\'>Dominator Platinum high-performance DDR4 memory is designed for world-class Intel 100 Series system builds. It\'s built with hand-screened ICs and incorporates patented DHX cooling for reliable performance in demanding environments. And, extracting maximum performance is easy -- built-in XMP 2.0 support gives you trouble-free, automatic overclocking. Dominator Platinum modules work with the Corsair Link system for temperature monitoring, and you can even enhance the subtle white LED lighting by adding a light bar kit to match or contrast it with your system.</p>\r\n</div>\r\n\r\n<div class=\"box-clear-40\" style=\'margin: 0px; padding: 5px 0px; height: 40px; clear: both; color: rgb(0, 0, 0); font-family: \"Gotham SSm A\", \"Gotham SSm B\"; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\'></div>\r\n\r\n<div class=\"product-detail-titles\" style=\'margin: 0px; padding: 0px; font-size: 22px; line-height: 24px; font-family: \"Open Sans\", arial, sans-serif; font-weight: normal; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\'>Designed for Intel 100 Series systems</div>\r\n\r\n<div style=\'margin: 5px 0px 0px; padding: 0px; color: rgb(0, 0, 0); font-family: \"Gotham SSm A\", \"Gotham SSm B\"; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\'>\r\n<p style=\'margin: 0px 0px 20px; padding: 0px; font-size: 14px; color: rgb(0, 0, 0); line-height: 19px; display: block; -webkit-margin-before: 1em; -webkit-margin-after: 1em; -webkit-margin-start: 0px; -webkit-margin-end: 0px; font-family: \"Open Sans\", arial, sans-serif;\'>Dominator Platinum DDR4 modules are designed to take advantage of the improved clock speeds, bandwidth, and capacity of the DDR4 platform. Our modules are tested across multiple 100 Series motherboards for reliably fast performance.</p>\r\n</div>\r\n\r\n<div class=\"box-clear-20\" style=\'margin: 0px; padding: 5px 0px; height: 20px; clear: both; color: rgb(0, 0, 0); font-family: \"Gotham SSm A\", \"Gotham SSm B\"; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\'></div>\r\n\r\n<p style=\'margin: 0px 0px 20px; padding: 0px; font-size: 14px; color: rgb(0, 0, 0); line-height: 19px; display: block; -webkit-margin-before: 1em; -webkit-margin-after: 1em; -webkit-margin-start: 0px; -webkit-margin-end: 0px; font-family: \"Open Sans\", arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\'><img src=\"http://www.corsair.com/en-eu/~/media/F5802A232DD94B8DB0C780FC8ADFA850.ashx?w=780\" style=\"max-width: 100%; width: auto; height: auto;\"></p>\r\n\r\n<div class=\"box-clear-20\" style=\'margin: 0px; padding: 5px 0px; height: 20px; clear: both; color: rgb(0, 0, 0); font-family: \"Gotham SSm A\", \"Gotham SSm B\"; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\'></div>\r\n\r\n<div class=\"product-detail-titles\" style=\'margin: 0px; padding: 0px; font-size: 22px; line-height: 24px; font-family: \"Open Sans\", arial, sans-serif; font-weight: normal; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\'>XMP 2.0 support for trouble-free, automatic overclocking</div>\r\n\r\n<div style=\'margin: 5px 0px 0px; padding: 0px; color: rgb(0, 0, 0); font-family: \"Gotham SSm A\", \"Gotham SSm B\"; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\'>\r\n<p style=\'margin: 0px 0px 20px; padding: 0px; font-size: 14px; color: rgb(0, 0, 0); line-height: 19px; display: block; -webkit-margin-before: 1em; -webkit-margin-after: 1em; -webkit-margin-start: 0px; -webkit-margin-end: 0px; font-family: \"Open Sans\", arial, sans-serif;\'>Dominator Platinum is fully compatible with the XMP 2.0 standard supported by Intel 100 Series-based motherboards. Turn it on, and it will automatically adjust to the fastest safe speed for your Dominator Platinum kit. Youll get amazing, reliable performance while maintaining full data integrity.</p>\r\n</div>\r\n\r\n<div class=\"box-clear-40\" style=\'margin: 0px; padding: 5px 0px; height: 40px; clear: both; color: rgb(0, 0, 0); font-family: \"Gotham SSm A\", \"Gotham SSm B\"; font-size: 12px; font-style: norma