irflow Platinum is designed for quiet operation and optimal cooling efficiency, and it works with Corsair Link for customization and control. Its included with some Dominator Platinum kits and optional with others.</p>\r\n\r\n<p style=\'margin: 0px 0px 20px; padding: 0px; font-size: 14px; color: rgb(0, 0, 0); line-height: 19px; display: block; -webkit-margin-before: 1em; -webkit-margin-after: 1em; -webkit-margin-start: 0px; -webkit-margin-end: 0px; font-family: \"Open Sans\", arial, sans-serif;\'>With Corsair Link, you can control PWM fan speed directly from your Windows desktop, and change the built-in LEDs from their default red to any of 16.8 million colors to indicate fan speed, ambient system temperature, or GPU temperature. Or, just set the LED lighting color to match your system or your style.</p>\r\n</div>\r\n\r\n<div class=\"box-clear-20\" style=\'margin: 0px; padding: 5px 0px; height: 20px; clear: both; color: rgb(0, 0, 0); font-family: \"Gotham SSm A\", \"Gotham SSm B\"; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\'></div>\r\n\r\n<p style=\'margin: 0px 0px 20px; padding: 0px; font-size: 14px; color: rgb(0, 0, 0); line-height: 19px; display: block; -webkit-margin-before: 1em; -webkit-margin-after: 1em; -webkit-margin-start: 0px; -webkit-margin-end: 0px; font-family: \"Open Sans\", arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); 